    <div className="container text-center">
      <h1 className="text-light">Créez votre compte dès maintenant</h1>
      <div className="row">
        <div className="w-540px">
          <input className="col" required></input>
        </div>

        <div>
          <input required></input>
        </div>

        <div>
          <input></input>
        </div>
      </div>
    </div>
  );
}
